INSERT INTO `product` (`ID_PRODUCT`, `NAME`, `BRAND`, `PRICE`, `DISCOUNT`, `QUANTITY`, `gambar`, `tmp_discount`, `product_detail`) VALUES
(4011, 'mawar biru ', 'de jogh', '100000', '500', '13', 'mawar biru.jpg', 1, 'Mawar biru pada awalnya hanyalah sebuah mawar putih yang dicelupkan kedalam cairan berwarna biru sehingga menghasilkan bunga warna biru. Sebagaimana diketahui, tidak ada pigmen warna biru alami di dalam bunga-bunga mawar ketika direproduksi dari bunga mawar biru yang sebenarnya dengan cara metode pembiakan tradisional.'),
(4015, 'Keladi ', 'kedelai', '100000', '5500', '102', 'keladi.jpg', 6, 'Tanaman hias keladi dikenal dengan nama latin Caladium. ... Adapun ciri dari keladi, yaitu bentuk daun lebar memanjang ke depan membentuk hati, daun tipis, corak warna yang mencolok seperti hijau, putih, pink, dan merah, berumbi, dan tidak memiliki batang namun memiliki tangkai daun yang panjang'),
(4016, 'Raflesia ', 'Arnoldi', '150000', '15000', '36', 'raflesia.jpg', 10, 'Padma raksasa (Rafflesia arnoldii) merupakan tumbuhan parasit obligat yang tumbuh di dalam batang tumbuhan merambat dari genus Tetrastigma. Rafflesia arnoldii terkenal karena memiliki bunga yang sangat besar, bahkan terbesar di dunia. Rafflesia arnoldii tidak memiliki daun sehingga tidak mampu berfotosintesis'),
(4019, 'Bonsai ', 'Bonbonsai', '1000000', '150000', '11', 'bonsai.jpg', 15, 'Jenis Tanaman Bonsai Terbaik – Tanaman bonsai adalah pohon yang dikerdilkan dan biasanya bisa ditanam dalam sebuah pot tanaman. Biasanya tanaman bonsai dibuat sebagai miniatur dari bentuk asli pohon besar yang sudah tua di alam bebas untuk hiasan maupun sebagai tujuan pembelajaran.'),
(4020, 'Kamboja ', 'Kambodia', '15000', '500', '103', 'kamboja.jpg', 3, 'Tanaman kamboja mempunyai pohon dengan tinggi batang 1,5-6 m, bengkok, dan mengandung getah. Tumbuhan asal Amerika ini biasanya ditanam sebagai tanaman hias di pekarangan, taman, dan umumnya di daerah pekuburan, atau tumbuh secara liar. Tumbuh di daerah dataran rendah 1-700 m di atas permukaan laut'),
(4021, 'Kaktus ', 'Kaktua', '10000', '5000', '4987', 'kaktus.jpg', 50, 'Kaktus adalah nama yang diberikan untuk anggota tumbuhan berbunga famili Cactaceae. Kaktus dapat tumbuh pada waktu yang lama tanpa air. Kaktus biasa ditemukan di daerah-daerah yang kering (gurun).'),
(4022, 'Mawar Merah ', 'BEAR BREAND', '15000', '500', '102', 'mawar merah.jpg', 3, 'Tanaman mawar berbentuk semak dan tergolong tanaman yang mempunyai umur panjang atau tahunan. Memiliki stuktur batang berkayu, bercabang banyak, menghasilkan bunga secara terus menerus. Selama siklus hidupnya tanaman mawar terus tumbuh seolah-olah tidak terbatas dan masa produksinya berulang-ulang (Rukmana, 1995).'),
(4023, 'Greta Flower ', 'BEAR BRAND', '5000', '500', '10002', 'bunga bagus.jpg', 10, 'INI BUNGA BAGUS BANGET'),
(4024, 'Monstera Obligua ', 'JANDA BOLONG', '1000000', '50000', '102', 'janda bolong.jpg', 5, 'Janda bolong memiliki daun lebar berlubang-lubang. Ia juga dikenal dengan nama keju Swiss dan tanaman lima lubang. Tanaman ini tersebar luas di sebagian besar Amerika Selatan dan Amerika Tengah. Selain itu janda bolong juga bisa ditemukan di Hindia Barat, terutama di dekat lembah sungai dataran rendah.'),
(4027, 'Lavendar ', 'OBAT NYAMUK', '5000', '0', '50', 'lavendar.png', 0, 'Bunga lavender adalah bunga berwarna ungu yang sangat anggun, memiliki aroma yang harum namun menenangkan, juga melambangkan kemurnian.');

